define("_KMS_ISP_HOSTINGS_SERVERS_TERMS","<div class=\"flex flex-grow flex-col max-w-full\"><div class=\"text-message flex flex-col items-start whitespace-pre-wrap break-words [.text-message+&amp;]:mt-5 juice:w-full juice:items-end overflow-x-auto gap-2\" dir=\"auto\" data-message-author-role=\"assistant\" data-message-id=\"d5d3000f-1cfd-43ff-8027-a766d8ceabfb\"><div class=\"flex w-full flex-col gap-1 juice:empty:hidden juice:first:pt-[3px]\"><div class=\"markdown prose w-full break-words dark:prose-invert dark\"><h3>General - Scope of Application</h3><p>The following terms and conditions apply to all commercial relationships between the customer and Intergrid (Opengea) (hereinafter \"Intergrid\"). The applicable law for this contract is the one valid at the time the offer is accepted. Additional or contradictory terms in the conditions are not part of the contract unless their validity is expressly agreed upon.</p><h3>Conclusion of the Contract</h3><p>Our offers are subject to change. We reserve the right to make technical and other changes as long as they are reasonable. In their orders, the customer is obligated to the tentative offer. We will confirm receipt of the customer's order once it has been executed. The confirmation is not contractual. The confirmation and acceptance of the contract may be incorporated jointly. The right to accept a contract offer (the order) is reserved within 5 business days following receipt. Intergrid also reserves the right to reject the order after examining the client's reliability.</p><h3>Scope of Services</h3><p>We guarantee an annual average network availability of 99% for our Data Center infrastructure. A service level agreement (SLA) applies as a guarantee. If the security of the power supply network or the maintenance of network integrity is at risk, we may temporarily restrict access to the service when necessary. The server is located in a Data Center in Germany, with optimal physical access for equipment protection and security. In the case of dedicated servers, the customer will have all server resources available: processing, storage, memory, and network, as well as root access. The services offered are those valid at the time the order is executed. If the client wishes to be registered with search engines (online content search engines), Intergrid is not responsible for this mediation. Search engine operators are solely responsible for the data and the time of admission to the search engine. The server will be owned by interconnected networks, responsible for maintaining computer components and ensuring the proper functioning of hardware components. Software and technical support related to applications running on the server are not included in dedicated hosting offers. If the client needs or desires such services, they will be charged separately.</p><h3>Data Integrity</h3><p>Intergrid regularly performs backups when this is part of the offer. In case of data loss, Intergrid will restore the last backup of the data as soon as possible, typically within the next 24 hours, with prior authorization from the client. The backup service has limited space. The conditions and frequency are specified with the offer. The client is obligated to perform a complete data backup before making any changes. The client will receive a user ID and password for security reasons. This must be kept confidential. The client is responsible for any negligence in the unauthorized use of the password. If the client becomes aware that unauthorized third parties know the password, they must inform us without delay. If the client is at fault for the misuse of the password by third parties, the client will be responsible for all user fees and damages. In case of suspicion, the client can request a new password from Intergrid.</p><h3>Personal Data Protection</h3><p>Our data protection practice complies with European personal data protection law and confidentiality in accordance with Directive 95/46/EC of the European Parliament and of the Council, of 24 October 1995. Clients' personal data will only be used if necessary for the creation, arrangement of content, or modification of the contractual relationship. The client is obligated to update or notify any changes to personal data to Intergrid. The client's email address will be used only to obtain information about orders, invoices, and, as long as the client does not object, for customer service, as well as our newsletter if the client wishes. Intergrid does not provide any client's personal information to third parties, except for our service partners to the extent necessary to determine remuneration and settlement with the client. The client has the right to information and the right to modify, suspend, or delete their stored information. If the deletion conflicts with a legal or contractual obligation to retain information, or other legal reasons, the information will be made inaccessible.</p><h3>Published Content</h3><p>It is the client's responsibility to identify Internet content as their own or as third-party content. The client's full name and address must be provided. Other obligations may arise from the provisions of the Telecommunications Act and the Teleservices Act. The client is obligated to examine these provisions and comply with them. The client undertakes not to publish content that may violate third-party rights or that violates the law. The placement of erotic, extreme pornographic, or content that is not considered tasteful is not permitted. We have the right to block access to any client's account that violates this. The same applies if the client publishes content that is capable of violating the rights of individuals or groups of people, or that insults or denigrates these people. This applies even without an actual legal claim. We are not obligated to review our clients' content. Sending SPAM is prohibited. This includes, in particular, the sending of illicit, unsolicited advertising to third parties. Regarding the sending of emails, it is prohibited to provide false sender information or to conceal the sender's identity by other means. We have the right to block access if this is not respected.</p><h3>Liability</h3><p>We assume no liability for direct damages, secondary damages, or loss of income due to technical problems and disturbances on the Internet that are not within our sphere of influence. As for contractors, we are not liable for slight negligence of contractual obligations. This does not apply in all cases of personal injury and is in accordance with product liability law. For consequential damages and lost profits, we are only liable in cases of intent or gross negligence. In this case, we are only liable for foreseeable damages typical of the contract, up to a maximum of 100% of the annual fee. If the client's web content violates paragraph 6 of the obligations, particularly violating legal or moral prohibitions, they will be liable to Intergrid for all resulting direct and indirect damages, including property damages. Additionally, the client undertakes to release us from all third-party claims - no matter what type - that may arise from the illicit content. The indemnity obligation includes liability for all legal defense costs (e.g., court and attorney fees).</p><h3>Payment Terms</h3><p>The current valid prices are accessible at any time at <a target=\"_new\" rel=\"noreferrer\" href=\"http://www.intergrid.cat\">http://www.intergrid.cat</a>. Depending on the contractual agreement, a monthly, quarterly, or annual account will be published. Other payments are made by issuing an invoice. Payment must be made within the next 15 days after receiving the invoice by default. We reserve the right to deduct, without prior notice, late payment interest as indicated in the invoices. If the client is a consumer/end-user, the amount of interest charged will be 5 percentage points above the base rate. If the client is a contractor/business, the interest applied will be 8 percentage points above the base rate. We also have the right, in case of payment default, to block the client's Internet presence and all other functions. Invoices are sent by email as attachments, upon request with a recognized signature. For retroactive invoice changes, which are caused by reasons beyond our control, we have the right to charge a reasonable service fee.</p><h3>Contract Duration / Termination / Place of Execution</h3><p>When there is no contractual agreement, contracts are in place for an indefinite period of time. The contract can be terminated without reason by both parties at any time with a period of 30 days for the end of the month, but not before the expiration of the minimum contract term stipulated in the contract. Termination can only be made after confirmation in writing, by email from the client's administrative account. We also have the right to terminate the contractual relationship for good cause and without prior notice. An important reason for termination would be if the client fails to pay a substantial part of the due compensation for two consecutive months. Another important reason, among others, may also be if the client violates or ignores warnings about the violation of the requirements of section 6. Another important reason, which may result in blocking or determination without prior notice, may be if the client uses content that affects the server's performance or security. The place of work for all services subject to this contract is Barcelona, Catalonia (Spain). The jurisdiction for all disputes arising from this contract is the corresponding Provincial Court of Barcelona if the client is a contractor, a public legal entity, or a special public fund. The same applies if the client has no general competence in Catalonia, or if the domicile or habitual residence at the time of the action is not known. If the client intends to transfer their contractual rights to another person, this requires our consent. The return of contractual rights can only be made by lemail, or through the secure online area of the administrations, provided this option is available. When the return is made by letter or fax, the previous and new contract partners must serve as signatures.</p><h3>Resellers / Distributors Regulations</h3><p>The client has the right to third-party contractual rights with the Internet presence provided by Intergrid. In this case, the client remains the sole contractor. The client undertakes all the terms of the contract, derived from the terms and conditions, as well as from our order forms, passing these on to all third parties and obliging them to comply with the terms. This also applies to the requirements of section 1.3 of these terms and conditions. When changes need to be made regarding third-party participation, the client is obligated to cooperate. The client must provide us with the third party's address and contact information upon request. We have the right, in the case of changes, to contact third parties directly to require their written agreement to the changes. The client is responsible for all third-party contractual breaches. The client is financially responsible to Intergrid for all resulting damages from third-party breaches. Additionally, they are exempt from liability for all claims that may arise from third parties and others.</p><h3>Cancellation Conditions</h3><p>Right of Withdrawal. You can revoke your contractual declaration, without providing reasons, by email within 2 weeks. The period begins after receiving this instruction in written form, but not before the conclusion of the contract. Compliance with the withdrawal period depends on the timely sending of the withdrawal. The withdrawal should be addressed to: Opengea SCCL, Carrer d'En Roig, 15 local, 08001, Barcelona. Catalonia. Consequences of Withdrawal. In the case of a valid withdrawal from this agreement, each party must return to the other party what is owed from the received benefits. Your right of withdrawal expires prematurely if the contract is fulfilled entirely by both parties at your specific request, before exercising your right of withdrawal. Refund obligations must be fulfilled within 30 days. The period begins for you upon sending your withdrawal, and for Intergrid upon receiving it.</p><h3>Inquiries and Complaints</h3><p>Inquiries and complaints should be addressed to Opengea SCCL, Carrer d'En Roig, 15 local, 08001, Barcelona. Catalonia.</p></div></div></div></div>",$case);
